			mainNavigationUls: getMainNavigationUls,
			last3MenuListItems: getLast4MenuListItems,
			last3MenuIconSvgs: getLast4MenuIconSvgs,
			last3MenuIconFigures: getLast4MenuIconFigures,
			menuIconSvgs: getMenuIconSvgs,
			navigationIconSvgBackgrounds: getNavigationIconSvgBackgrounds,
			homeIconFigure: getHomeIconFigure,
