WebPage.prototype.setup = function () {
	var webPage = this;

	htmlSetup();
	webPage.events({type: "navigation", event: "primary"});

	function htmlSetup() {
		headSetup();
		bodySetup();

		function headSetup() {
			var headTagChildKey;
			var headTagChild;

			for (headTagChildKey in webPage.html.head) {
				headTagChild = webPage.html.head[headTagChildKey];

				document.head.appendChild(headTagChild);
			}
		}

		function bodySetup() {
			navigationSetup();
			timelineSetup();

			function navigationSetup() {
				mainNavigationSetup();

				function mainNavigationSetup() {
					appendElements();
					
					webPage.updateUi({
						type: "mainNavigation",
						modify: "primary",
					});

					function appendElements() {
						webPage.html.body.navigation.appendChild(webPage.html.body.navigationIconList);
					}
				}
			}

			function timelineSetup() {
				webPage.updateUi({
					type: "timelineFigure",
					modify: "primary",
				});

				webPage.html.body.timelineFigure.appendChild(webPage.html.body.navigation);

				document.body.appendChild(webPage.html.body.timelineFigure);
			}
		}
	}
};

