	function style(styleInfo) {
		var target;

		if (webPage.regex.array.test(styleInfo.target.constructor.name)) {
			styleTargets();
		} else {
			styleTarget();
		}

		function styleTargets() {
			var targetIndex;

			for (targetIndex = 0; targetIndex < styleInfo.target.length; targetIndex ++) {
				target = styleInfo.target[targetIndex];
				setTargetStyle();
			}
		}

		function styleTarget() {
			target = styleInfo.target;
			setTargetStyle();
		}

		function setTargetStyle() {
			var attributeNames;
			var attributeName;
			var attributeValue;
			var attributeIndex;

			transformCheck();
			attributeNames = Object.keys(styleInfo.attributes);


			for (attributeIndex = 0; attributeIndex < attributeNames.length; attributeIndex ++) {
				attributeName = attributeNames[attributeIndex];
				attributeValue = styleInfo.attributes[attributeName];

				target.style[attributeName] = attributeValue;
			}

			function transformCheck() {
				var attributeNames = Object.keys(styleInfo.attributes);
				var attributeName;
				var attributeValue;
				var attributeIndex;

				for (attributeIndex = 0; attributeIndex < attributeNames.length; attributeIndex ++) {
					attributeName = attributeNames[attributeIndex];
					
					if (webPage.regex.transform.test(attributeName)) {
						attributeValue = styleInfo.attributes[attributeName];

						styleInfo.attributes.webkitTransform = attributeValue;
						styleInfo.attributes.mozTransform = attributeValue;
						styleInfo.attributes.oTransform = attributeValue;
					}

					if (webPage.regex.transition.test(attributeName)) {
						attributeValue = styleInfo.attributes[attributeName];

						styleInfo.attributes.webkitTransition = attributeValue.replace(/(^transform\b)/, "-webkit-$1");
						styleInfo.attributes.mozTransition = attributeValue.replace(/(^transform\b)/, "-moz-$1");
						styleInfo.attributes.oTransition = attributeValue.replace(/(^transform\b)/, "-o-$1");
					}
				}
			}
		}
	}
